Made in FOOT, votre source d'info foot, décline son offre sur votre club favori : le LOSC !
Suivez toute l'info foot du LOSC gratuitement sur votre mobile, grâce à l'application Foot Lille (Infos, Analyses, Interviews, Mercato, Résumés de matchs).
Obtenez tous les résultats du LOSC en direct live (Compos, Actions, Statistiques, Photos).

Téléchargez gratuitement l'application Foot Lille et profitez :
- De toutes les infos foot du LOSC (Mercato, Interviews, Analyses, Résumés) ;
- Des matchs de foot en direct (Résultats, Compositions, Statistiques, etc.) ;
- De tous les résultats, calendriers, classements et effectif ;
- Des photos de tous les matchs du LOSC.

Où que vous soyez, restez connecté 24h/24 à l'actualité et aux résultats de votre équipe préférée : le LOSC.

· Record your fitness accurately
Support running, cycling, walking and other activities;
· Multi-dimensional evaluation of body state
Make fitness, weight loss and exercise more scientific through FitFly;
Each exercise can obtain professional physiological indexes, so that exercise more scientific and effective;
· Find more fun in life
Support exercise track record, playback of your fitness records;
Tips:
This application supports Apple Health. With authorization, you can synchronize your steps, sleep, heart rate and other health data to Apple Health.
